// N : participants.length

function solution(participants, completions) {
  var answer = '';

  if(!(participants.length>=1 && participants.length<=100000 && participants.length===completions.length+1)) {
    return answer;
  }

  // 1번 해법
  // participants 순회 * completions 순회 2번(completions.indexOf, completions.splice)
  // O(N*2*(N-1)) = O(2N^2)
  // answer = solution1(participants, completions);

  // 2번 해법
  // 결국 관건은 participants 전체 순회(O(N))는 피할 수 없으므로 compeletions 배열을 순회(O(2*(N-1))를 줄이는 작업
  // completions을 가공하여 첫 글자를 hash key로 갖는 새로운 hashTable을 만든다
  // completions 순회(genCharHashTable) + participants 순회 * (최악의 경우 모두 첫 글자가 같은 경우) completions
  // O((N-1) + (N*(N-1))) = O(N^2)
  // 최악의 경우 절반의 big-O로 해결할 수 있지만 실제로는 훨씬 나은 성능을 보임
  // solution1의 O가 solutionWithInitialHash O보다 항상 크므로 N의 조건에 상관없이 solutionWithInitialHash 해결
  // answer = solutionWithInitialHash(participants, completions);

  answer = solutionWithDictionaryHash(participants, completions);

  return answer;
}

function solution1(participants, completions) {
  var answer = '',
    participant = null,
    matchedIdx = -1;

  for(var i=0; i<participants.length; i++) {  // O(N)
    participant = participants[i];
    matchedIdx = completions.indexOf(participant);  // O(N-1)
    if(matchedIdx<0) {
      answer = participant;
      break;
    } else {
      completions.splice(matchedIdx, 1);  // O(N-1)
    }
  }
  return answer;
}

function genCharHashTable(arrs) {
  return arrs.reduce((accum, temp)=>{
    var charIdx = temp[0];
    if(accum[charIdx]) {
      accum[charIdx].push(temp);
    } else {
      accum[charIdx] = [];
      accum[charIdx].push(temp);
    }
    return accum;
  }, {});
}

function solutionWithInitialHash(participants, completions) {
  var answer = '',
    participant = null;
  var charHashTable = genCharHashTable(completions);    // O(N-1)

  for(var i=0; i<participants.length; i++) {  // O(N)
    participant = participants[i];
    if(participant.length<1 || participant.length>20) {
      answer = participant;
      break;
    }

    var charIdx = participant[0],
      charIdxParticipants = charHashTable[charIdx],
      participantIdx = charIdxParticipants? charIdxParticipants.indexOf(participant) : -1;
    if(participantIdx<0) {
      answer = participant;
      break;
    } else {
      charIdxParticipants.splice(participantIdx, 1);
    }
  }
  return answer;
}

function solutionWithDictionaryHash(participants, completions) {
  var answer = '',
    participant = null;
  var charHashTable = new CharHashTable(completions);    // O(N-1)

  for(var i=0; i<participants.length; i++) {  // O(N)
    participant = participants[i];

    // 완료자 목록에서 해당 참석자가 있는지 확인한 후에 있으면 지우고 없으면 해당 참가자가 없는 경우라 바로 종료
    var findResult = charHashTable.findAndRemove(participant);

    if(!findResult) {
      return participant;
      break;
    }
  }
  return answer;
}

class CharHashTable {
  constructor(strs) {
    this.hashTable = {};
    this.init(strs);
  }
  init(strs) {
    strs.forEach((ele) => {
      this.destruct(ele.replace(/ /g, '_'), this.hashTable, ele);
    });
  }
  insert(obj, str) {
    if(obj.data) {
      obj.data.push(str);
    } else {
      obj.data = [str];
    }
  }
  makeCharIndex(char, obj) {
    if(!obj[char]) {
      obj[char] = {};
    }
    return obj[char];
  }
  destruct(str, obj, all) {
    var c = str[0],
      rest = str.slice(1);

    obj = this.makeCharIndex(c, obj);

    // 종단점 설정
    if(!rest) {
      this.insert(obj, all);
    } else {
      this.destruct(rest, obj, all);
    }
  }
  find(str) {
    var data = this.findData(str.split(''), this.hashTable);
    if(data && Array.isArray(data)) {
      return data.length > 0;
    } else {
      return false;
    }
  }
  findAndRemove(str) {
    var data = this.findData(str.replace(/ /g, '_').split(''), this.hashTable);
    if(data && Array.isArray(data) && data.length > 0) {
      data.pop();
      return true;
    } else {
      return false;
    }
  }
  findData(chars, obj) {
    var char = chars[0],
      rest = chars.slice(1);

    // 종단점 지정
    if(!char || !obj[char]) {
      return (obj.data && obj.data.length > 0) ? obj.data : false;
    } else {
      obj = obj[char];
      return this.findData(rest, obj);
    }
  }
  remove(chars, obj) {
    var char = chars[0],
      rest = chars.slice(1);

    // 종단점 지정
    if(!char || !obj[char] || obj.data) {
      return (obj.data && obj.data.length > 0) ? true : false;
    } else {
      obj = obj[char];
      return this.findData(rest, obj);
    }
  }
  log() {
    console.log(JSON.stringify(this.hashTable));
  }
}

